import Logout from '../assets/logouticon.png'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSignOutAlt } from '@fortawesome/fontawesome-free';
function dashboard() {
  return (
   <div>
   <div style={{ color : 'white'}}>;edl,</div>
   <button> <icon></icon>
   <div>
      <FontAwesomeIcon icon={faSignOutAlt} />
    </div>
    <img   src={Logout} className='img bg-transparent' alt="Logout"  />  </button>
    <div><Sidebar/></div>
   
</div>

  
  )
}

export default dashboard
